import classes from "./PlayerItem.module.css";

const PlayerItem = (props) => {
  return (
    <>
      <div className={classes.playerItemHeader}>
        {props.name}, {props.position}{" "}
      </div>
      <div className={classes.playerItemStats}>
        <h2>Solo Q information</h2>
        <p style="color: blue;">Rank: {props.rank} </p>
        <p>Winrate: {props.winRate} </p>
        <p>Main role: {props.mainRole}</p>
      </div>
    </>
  );
};

export default PlayerItem;
